import React from 'react'
import AccountBox from 'material-react-icons/AccountBox'

class Player extends React.Component {
    constructor(props){
        super(props)
        this.player = {
            "player_id": 9,
            "username": "player_one"
        }
    }
    render() {
        return (
            <div className="player">
                <AccountBox /><h2>Player Id: {this.player.player_id}</h2>
                <h2>Username:: {this.player.username}</h2>
            </div>
        )
    }
}

export default Player
